import React, { Component } from 'react'
import TodoList from './TodoList'

class App extends Component {
  constructor(props){
    super(props)
    this.state = {
      greeting: 'hello'
    }
  }
  render() {
    return (
      <div className="TodoApp">
        <TodoList className='container-fluid' todos={this.state} />
        {/* <AddForm /> */}
      </div>
    );
  }
}

export default App
